export default function ArchivePageInfoSchema({ info }) {

    const newLocal = <p className="consistencyInfo">
        {info[0].map(consistenza => {
            <>
                <b>{consistenza.inventoryitemname}:</b>
                <p>{consistenza.itemQuantity}</p>
            </>;
        })}
    </p>;
    return (
        <>
        {newLocal}
        <p className="chronologyInfo">
            <b>Cronologia:</b>
            <p>{info[1].chronologyStartYear} - {info[1].chronologyEndYear}</p>
        </p>
        <p className="referenceToolInfo">
            <b>Strumenti di corredo:</b>
            <ul>
                {info[2].map((strumento, index) => (
                    <li key={index}>{strumento.nameReferenceTool}</li>
                ))}
            </ul>
            
        </p>
        </>
    );
}
